import { gql } from "@apollo/client";

export const LOGIN_WITH_GOOGLE_MUTATION = gql`
  mutation Login($code: String!, $service: String!) {
    loginForLogin(code: $code, service: $service) {
      token
      user {
        email
        firstName
        lastName
        avatar {
          url
        }
      }
    }
  }
`;
